import headerLogo from "../../images/cat.svg";

const Header = () => {
  return (
    <>
      <img src={headerLogo} alt="header-logo" />
      <h1>TESKTASK</h1>
      <a href="#users-list">USERS</a>
      <a href="#sign-in-form">Sign In</a>
    </>
  );
};

export default Header;
